import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AdminLogin from "./components/AdminLogin";
import Home from "./components/Home";
import About from "./components/About";
import Contact from "./components/Contact";
import "./App.css";

// Image assets (you can replace these links with your own images)
const carouselImages = [
  "https://d1sl07a7h3d3fr.cloudfront.net/admin/store/pothys/banner/Final+5.jpg",
  "https://d1sl07a7h3d3fr.cloudfront.net/admin/store/991fba9e-84cc-4c71-9004-41d30e4eec5b-Final4.jpg",
  "https://d1sl07a7h3d3fr.cloudfront.net/admin/store/7d26cbfb-6d99-46d8-9406-a5a0c43c5854-pothysnatchiyar.jpeg"
];

const discountItems = [
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/admin/product/opt_cabd5df8-8747-4ddc-baab-ab5056729bdf-3ROSESNATURALCARE250G.jpg", label: "50% Off" },
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/admin/product/opt_cf5fbbe0-64ad-4f88-847c-080497a42122-81iqerdejSL.jpg", label: "Buy 1 Get 1" },
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/common/master/opt_maggi_masala_noodles_420gm.jpg", label: "Clearance Sale" },
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/admin/product/opt_3daff702-d021-4ee4-9a60-b31df11d3897-61ak1gbTTXL.jpg", label: "Exclusive Deals" },
];

const categories = [
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/admin/category/4de2aaf9-8151-4582-a53f-11f99c0656f1-7.jpg", label: "Electronics" },
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/admin/category/68aebc4c-9b70-4846-8ab3-20a8f392327c-5(2).jpg", label: "Fashion" },
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/admin/category/69ae604e-9916-4f94-ba47-85db5f0ffeb8-10.jpg", label: "Groceries" },
  { image: "https://d1sl07a7h3d3fr.cloudfront.net/admin/category/66588801-343c-4fd1-a6b8-dbcfa2dd66e4-13.jpg", label: "Home Appliances" }
];

function App() {
  const [currentSlide, setCurrentSlide] = useState(0);
  const [isLoading, setIsLoading] = useState(true);

  // Carousel functionality
  const nextSlide = () => {
    setCurrentSlide((prev) => (prev + 1) % carouselImages.length);
  };

  const prevSlide = () => {
    setCurrentSlide((prev) => (prev - 1 + carouselImages.length) % carouselImages.length);
  };

  useEffect(() => {
    const interval = setInterval(nextSlide, 3000); // Auto-change slide every 3 seconds
    return () => clearInterval(interval); // Cleanup interval on unmount
  }, []);

  useEffect(() => {
    setIsLoading(false);
  }, []);

  return (
    <div className="App">
      <nav className="navbar">
        <div className="logo">Velavan Super Stores</div>
        <ul className="nav-links">
          <li><a href="#">Products</a></li>
          <li><a href="#">Cart</a></li>
          <li><a href="#">Invoice</a></li>
          <li><button className="logout-btn">Log Out</button></li>
        </ul>
      </nav>

      <div className="description">
        <h3>
          "Velavan Super Stores is your one-stop destination for a wide range of products, from electronics and fashion to groceries and home appliances. We bring you the best deals, exclusive discounts, and popular brands, ensuring a seamless shopping experience with unbeatable offers and top-notch quality."
        </h3>
      </div>

      {/* Carousel */}
      <div className="carousel">
        {carouselImages.map((img, index) => (
          <div
            key={index}
            className={`slides ${currentSlide === index ? "active" : ""}`}
          >
            <img src={img} alt={`Offer ${index + 1}`} />
          </div>
        ))}
        <button className="prev" onClick={prevSlide}>&#10094;</button>
        <button className="next" onClick={nextSlide}>&#10095;</button>
      </div>

      {/* Discount Grid */}
      <section className="image-grid">
        {discountItems.map((item, index) => (
          <div className="grid-item" key={index}>
            <img src={item.image} alt={`Discount ${index + 1}`} />
            <p>{item.label}</p>
          </div>
        ))}
      </section>

      <div className="footer-description">
        <p>Enjoy the best shopping experience with exciting discounts and special offers, only at Velavan Super Stores!</p>
      </div>

      {/* Shop By Category */}
      <h2 style={{ textAlign: "center", padding: "20px" }}>Shop By Category</h2>
      <section className="category-grid">
        {categories.map((category, index) => (
          <div className="category-item" key={index}>
            <img src={category.image} alt={`Category ${index + 1}`} />
            <p>{category.label}</p>
            <button>Shop Now</button>
          </div>
        ))}
      </section>
    </div>
  );
}

export default App;
